import './App.css';
import { BrowserRouter ,Routes,Route} from 'react-router-dom'
import Header from './components/Header';
import NotesListPage from './pages/NotesListPage';

function App() {
  return (
    <BrowserRouter>
    <div className="App">
      <Header/>
    <Routes>
      <Route path="/" exact element={ <NotesListPage/>}/>
    </Routes>
    </div>
    </BrowserRouter>


  );
}

export default App;
